// ==UserScript==
// @name           RandomProxyHeader
// @namespace      http://stackoverflow.com/users/982924/rasg
// @author         RASG
// @version        2012.06.14
// @description    [EN] Load webpages and links through a random proxy based on the server response (403). If not found (404), loads the cached version of the page. [PT] Carrega paginas e links atraves de um proxy aleatorio, mas baseado na resposta do servidor (403). Se a pagina nao for encontrada (404), carrega a versao disponivel em algum cache.
// @require        http://code.jquery.com/jquery.min.js
// @include        *
// @exclude        *builder.addons.mozilla.org*
// @exclude        *stackoverflow*
// ==/UserScript==


var ativarlog = false
var proxylist = ['https://cache-001.appspot.com/','https://cache-003.appspot.com/','https://cache-017.appspot.com/','https://meme-darwin.appspot.com/'];
var cachelist = ['https://webcache.googleusercontent.com/search?strip=1&q=cache:','http://web.archive.org/web/*/','http://www.webcitation.org/query.php?url='];
var proxy = proxylist[Math.floor(Math.random() * proxylist.length)];
var cache = cachelist[Math.floor(Math.random() * cachelist.length)];
var ignorar_links = ['autenticar','encerrar','entrar','exit','fim','igoogle','log in','login','log out','logout','log on','logon','log off','logoff','quit','sair','sign in','signin','sign out','signout'];

var icone_p = 'data:image/png;base64,';
var icone_g = 'data:image/png;base64,';

function a_hora(){ var agora = new Date(); var retornar = agora.getHours()+':'+agora.getMinutes()+':'+agora.getSeconds(); return retornar; }
function GM_wait(){ if (typeof unsafeWindow.$ == 'undefined') { window.setTimeout(GM_wait, 500) } }

GM_wait();

$(window).load(function(){

    $('a[href]').each(function(idx){
        var linkk = $(this)
        var linkkhref = linkk.attr('href');
        var linkktext = $.trim( linkk.text().toLowerCase() );
        
        linkk.attr({'rel' : 'noreferrer'})
        if ( ($.inArray(linkktext, ignorar_links) == -1) && (linkkhref.search(/log/i) == -1) ) {
            if (window.location.hostname.match(/(askubuntu|bing|serverfault|stack|superuser|userscripts|yahoo)/i)) {
                window.setTimeout(function(){
                    conectar('HEAD', linkkhref, resp)
                    if (ativarlog == true) {
                        GM_log([
                            'hora da requisicao :: ' + a_hora(),
                            'dominio            :: ' + window.location.hostname,
                            'texto do link      :: ' + linkktext,
                            'href do link       :: ' + linkkhref,
                            'delay              :: ' + idx*1000
                        ].join("\n"));
                    }
                }, idx*1000)
            }
            else if (window.location.hostname.match(/google/i)) {
                unsafeWindow.rwt = function(){};
                window.setTimeout(function(){
                    conectar('HEAD', linkkhref, resp)
                    if (ativarlog == true) {
                        GM_log([
                            'hora da requisicao :: ' + a_hora(),
                            'dominio            :: ' + window.location.hostname,
                            'texto do link      :: ' + linkktext,
                            'href do link       :: ' + linkkhref,
                            'delay              :: ' + idx*1500
                        ].join("\n"));
                    }
                }, idx*1500)
            }
            else {
                window.setTimeout(function(){
                    conectar('HEAD', linkkhref, resp)
                    if (ativarlog == true) {
                        GM_log([
                            'hora da requisicao :: ' + a_hora(),
                            'dominio            :: ' + window.location.hostname,
                            'texto do link      :: ' + linkktext,
                            'href do link       :: ' + linkkhref,
                            'delay              :: ' + idx*500
                        ].join("\n"));
                    }
                }, idx*500)
            }
        }

        function conectar(metodo, endereco, resposta, corpo) {
            callback = function(xhr) { resposta(xhr) };
            GM_xmlhttpRequest({
                "method"    : metodo,
                "url"        : endereco,
                "onerror"    : callback,
                "onload"    : callback,
                "headers"    : {'Content-Type' : 'application/x-www-form-urlencoded'},
                "data"        : corpo
            });
        }

        function resp(responseDetails) {
            if (responseDetails.status == 403) {
                linkk.css({'background':'url('+icone_p+') center no-repeat'})
                linkk.attr({'href' : proxy + linkkhref.substring(7), 'title' : '403 - Forbidden'})
            }
            else if (responseDetails.status == 404) {
                linkk.css({'text-decoration':'line-through'})
                linkk.attr({'href' : cache + linkkhref.substring(7), 'title' : '404 - Not Found'})
            }
            else if (responseDetails.status == 407) {
                linkk.css({'border':'blue dotted 1px'})
                linkk.attr({'href' : proxy + linkkhref.substring(7), 'title' : '407 - Proxy Authentication Required'})
            }
            if (ativarlog == true) {
                GM_log([
                    'hora da resposta :: ' + a_hora(),
                    'finalUrl         :: ' + responseDetails.finalUrl,
                    'texto do link    :: ' + linkktext,
                    'status           :: ' + responseDetails.status,
                    'statusText       :: ' + responseDetails.statusText,
                    'readyState       :: ' + responseDetails.readyState,
                    'responseHeaders  :: ' + responseDetails.responseHeaders,
                    'responseXML      :: ' + responseDetails.responseXML
                ].join("\n"));
            }
        }
    });

});